	(54, 1, '10.b-bonus-lamp-digital-ocean', NULL, NULL, 10, NULL, 'Get your hands dirty in Linux if you never have before. I\'ll show you how to setup a Linux Server, with a Virtual Host, and how to run all that you need! It\'s very easy!', 0, NULL, NULL, NULL),
	(55, 2, '1.1-explaining-mvc', 1, 1, 1, 1, 'Learn how the MVC pattern works within a few minutes with a diagram and code samples.', 0, NULL, NULL, NULL),
