	(69, 2, '4.2-post-class-and-jquery-ajax', NULL, NULL, 4, 2, 'We are going to make the login work with a series of things: The Input Class (Optional), The Session Class, Adjusting the User Model, and adding a fake database user.', 0, NULL, NULL, NULL),
	(70, 2, '4.3-encryption-vs-hashing', NULL, NULL, 4, 3, 'Know the difference between Encryption and Hashing. We\'ll use what we\'ve learned for securing our user passwords. ', 0, NULL, NULL, NULL),
