	(80, 2, '8.1-crud-get', NULL, NULL, 8, 1, 'We are going to Abstract the Active-Record and build out a re-usable CRUD model and begin with the GET ability. This will make queries and models a lot more convenient.', 0, NULL, NULL, NULL),
