	(201, 6, '4.1-composer-packagist', NULL, NULL, 4, 1, NULL, 0, NULL, NULL, NULL),
	(202, 7, '1.1-git-setup', NULL, NULL, 1, 1, 'Setting up Git is easy, You can use a GUI or Terminal, however we will be using the Terminal.', 0, NULL, NULL, NULL),
	(203, 7, '1.2-git-repository', NULL, NULL, 1, 2, 'Repositories are the containers which hold your code. Just think of it as a box that keeps track of all your changes in organized folders.', 0, NULL, NULL, NULL),
	(204, 7, '1.3-git-basics', NULL, NULL, 1, 3, 'These are the basic commands of the GIT Terminal', 0, NULL, NULL, NULL),
	(205, 7, '1.4-git-branch', NULL, NULL, 1, 4, 'You can have a Git Repository with multiple branches. This basically means you separate your project into various parts if you like, and when ready pull them all together by merging.', 0, NULL, NULL, NULL),
	(206, 7, '1.5-git-merge-conflict', NULL, NULL, 1, 5, 'Sometimes a merge conflict will happen. It\'s easy to resolve, here is a basic overview', 0, NULL, NULL, NULL),
	(207, 8, '1.1-why-learn', 1, NULL, 1, 1, 'HTML is foundational to any web development work. It\'s easy to learn because it\'s a tagging system and is less of a programming language.', 0, NULL, NULL, NULL),
