	(213, 8, '2.5-html-forms', NULL, NULL, 2, 5, 'You use forms on pretty much every website. This is how you build one, yet to give it functionality you would need a server-side language to process it to do something.', 0, NULL, NULL, NULL),
	(214, 8, '2.6-dom', NULL, NULL, 2, 6, 'The Document Object Model (DOM) is a tree structure of your HTML layout.', 0, NULL, NULL, NULL),
