	(242, 10, '1.1-virtual-box-download', NULL, NULL, 1, 1, 'Get started with VirtualBox, It\'s free, easy, and works on every OS.', 0, NULL, NULL, NULL),
	(243, 10, '1.2-install-linux-on-windows', NULL, NULL, 1, 2, 'We\'ll install Linux inside of Windows to demonstrate the power of VirtualBox.', 0, NULL, NULL, NULL),
	(244, 10, '1.3-install-guest-additions', NULL, NULL, 1, 3, 'Guest Additions allow the Guest Machine (Linux) to receive additional settings from the host (Windows).', 0, NULL, NULL, NULL),
	(245, 10, '2.1-primary-settings', NULL, NULL, 2, 1, 'This is a quick breakdown of the main settings.', 0, NULL, NULL, NULL),
	(246, 10, '3.1-virtualbox-linux', NULL, NULL, 3, 1, 'Here is an example of having many windows installations under Ubuntu. Please take note of the flag incase you need to set it in your terminal: <code>vboxmanage setextradata "The Box Name" VBoxInternal/CPUM/CMPXCHG16B 1</code>', 0, NULL, NULL, NULL),
	(247, 9, '1.1-intro', 1, NULL, 1, 1, 'What is Redis and who uses it?', 0, NULL, NULL, NULL),
	(248, 9, '1.2-install', 1, NULL, 1, 2, 'We\'ll install Redis on Linux, you can optionally use Windows but a CLI and Linux is preferred.', 0, NULL, NULL, NULL),
	(249, 9, '1.3-config-glance', NULL, NULL, 1, 3, 'A glance at the Redis configuration.', 0, NULL, NULL, NULL),
	(250, 9, '1.4-system-basics', NULL, NULL, 1, 4, 'The basics of using Redis Commands.', 0, NULL, NULL, NULL),
	(251, 9, '2.1-string', NULL, NULL, 2, 1, 'Using the String Data Type.', 0, NULL, NULL, NULL),
	(252, 9, '2.2-more-string-options', NULL, NULL, 2, 2, 'More options with the String Data Type.', 0, NULL, NULL, NULL),
	(253, 9, '3.1-php-client', NULL, NULL, 3, 1, 'Client integration using PHP and Composer with the PRedis package.', 0, NULL, NULL, NULL),
	(254, 9, '3.2-hashes', NULL, NULL, 3, 2, 'Learn the Hash Data Type.', 0, NULL, NULL, NULL),
	(255, 9, '3.3-lists', NULL, NULL, 3, 3, 'Learn the List Data Type.', 0, NULL, NULL, NULL),
	(256, 9, '4.1-python-redis', NULL, NULL, 4, 1, 'Client integration using Python and PIP.', 0, NULL, NULL, NULL),
	(257, 9, '4.2-sets', NULL, NULL, 4, 2, 'Using the Set Data Type.', 0, NULL, NULL, NULL),
	(258, 9, '4.3-sorted-sets', NULL, NULL, 4, 3, 'Using the Sorted Set Data Type, which is like a set but has an order to it based on a score for each value. This adds many more commands to this data type, we\'ll cover a bulk of them.', 0, NULL, NULL, NULL),
	(259, 9, '5.1-hyperloglog', NULL, NULL, 5, 1, 'HyperLogLog is used for Counting. This is an overview of why you might use it.', 0, NULL, NULL, NULL),
	(260, 9, '5.2-pubsub', NULL, NULL, 5, 2, 'This allows to have a chatroom-like system already built out. Subscribe a Client to a channel, and Publish Messages. It\'s pretty straight forward and is a perfect foundation for a chat room and probably a lot of other creative things you could think up!', 0, NULL, NULL, NULL),
	(261, 9, '6.1-transactions', NULL, NULL, 6, 1, 'Transactions are for making sure a bundle of commands all execute succesfully, otherwise it will fail. You will see the failure in action too! This is pretty much like an SQL transaction.', 0, NULL, NULL, NULL),
	(262, 9, '6.2-connection-commands', NULL, NULL, 6, 2, 'The current connection commands which are terribly simple to use.', 0, NULL, NULL, NULL),
	(263, 11, '1.1-install-windows', NULL, NULL, 1, 1, 'Installing Python and Django on windows is a bit more work than on Linux or OSX, however it works just as fine once you follow these steps.', 0, NULL, NULL, NULL),
	(264, 11, '1.2-install-linux', NULL, NULL, 1, 2, 'Python ships with Linux, so you don\'t have to do very much.', 0, NULL, NULL, NULL),
	(265, 11, '1.3-project-setup', NULL, NULL, 1, 3, 'Here we will setup our project to begin learning.', 0, NULL, NULL, NULL),
	(266, 11, '1.4-editor-setup', NULL, NULL, 1, 4, 'This is how I\'ll use my text editor, this is optional to you but you may find it handy to use the Sublime PythoneIde addon.', 0, NULL, NULL, NULL),
	(267, 11, '2.1-project-and-app-overview', NULL, NULL, 2, 1, 'Django Lingo, How the application structure works starting with pojects and apps.', 0, NULL, NULL, NULL),
	(268, 11, '2.2-landing-pages', NULL, NULL, 2, 2, 'We start by creating some simple landing pages and templates.', 0, NULL, NULL, NULL),
	(269, 11, '2.3-template-extending', NULL, NULL, 2, 3, 'We\'ll learn code re-use by keeping a base template which we can extend any template from.', 0, NULL, NULL, NULL),
	(270, 11, '2.4-setup-staticfiles', NULL, NULL, 2, 4, 'To serve static files locally you need to setup a few options, then you are ready to roll. At times this can become very confusing, so just follow my directions!', 0, NULL, NULL, NULL),
	(271, 11, '3.1-first-model', NULL, NULL, 3, 1, 'We create our first model which defines how we want to structure our table for our database.', 0, NULL, NULL, NULL),
	(272, 11, '3.2-improve-template', NULL, NULL, 3, 2, 'We jump back to the template and tidy up the visuals.', 0, NULL, NULL, NULL),
	(273, 11, '3.3-model-to-view', NULL, NULL, 3, 3, 'We will prepare a new template to display our model (database) data to our view.', 0, NULL, NULL, NULL),
	(274, 11, '3.4-fixtures', NULL, NULL, 3, 4, 'We\'ll prepopulate the database at any time needed using fixutres. This can be useful for fake data, or passing projects along to a co-worker.', 0, NULL, NULL, NULL),
	(275, 11, '3.5-blog-pages', NULL, NULL, 3, 5, 'We add the Posts and Category pages and setup a route for them. There are a handful of code changes in here so take your time if you need to.', 0, NULL, NULL, NULL),
	(276, 11, '3.6-categories-and-pagination', NULL, NULL, 3, 6, 'Add the posts to their designated category pages. We make a few more posts in the fixture, and realize it\'s more convenient to make a bash script to insert them. We then setup pagination.', 0, NULL, NULL, NULL),
	(277, 11, '4.1-upgrade-django-and-admin', NULL, NULL, 4, 1, 'We upgrade Django and start setting up the Admin panel.', 0, NULL, NULL, NULL),
	(278, 11, '4.2-fancy-admin', NULL, NULL, 4, 2, 'We install django-suit to make the admin look nicer. Another option is grappelli. Then we adjust the admin fields for a better display and practice.', 0, NULL, NULL, NULL),
	(279, 11, '4.3-tidying-bugs', NULL, NULL, 4, 3, 'Here we fix a few bugs produced by changing the template, add to the navigation, and tweak the admin so things display textually correct and allow posts with the missing category.', 0, NULL, NULL, NULL),
	(280, 11, '4.4-auto-slugify', NULL, NULL, 4, 4, 'To save us an inconvenience we will apply the autoslugify package and make life a lot more convenient. We also add a published Boolean field, migration time!', 0, NULL, NULL, NULL),
	(281, 11, '5.1-refactor-folders', NULL, NULL, 5, 1, 'We refactor our Django Applications into a designated apps folder to make a growing project more manageable.', 0, NULL, NULL, NULL),
	(282, 11, '5.2-refactor-settings', NULL, NULL, 5, 2, 'We refactor the settings to support multiple environments for development, and production. This is a long code video, It\'d be great to follow but if you get stuck please watch the exporting an environment variable in the console to set our Django settings file, and also check the code commit in the repository labeled "refactor-settings".', 0, NULL, NULL, NULL),
	(283, 11, '5.3-refactor-requirements', NULL, NULL, 5, 3, 'We will match our environments with our dependencies. This is a very easy video!', 0, NULL, NULL, NULL),
	(284, 11, '6.1-nba-app', NULL, NULL, 6, 1, 'We start a new app, which is quite unique only containing a model and admin section. To get the fixture data I provided please visit this URL: https://bitbucket.org/JREAM/learn-django/src/701d048ffde84dd1889d9c99bc53c3def43c0a2d/zeus/apps/nba/fixtures/teams_initial.json?at=master', 0, NULL, NULL, NULL),
	(285, 11, '6.2-nba-teampick-app', NULL, NULL, 6, 2, 'We pickup from the nba-app and create a model and solve some logical issues so that users will be able to rank teams in the order they believe will win.', 0, NULL, NULL, NULL),
	(286, 11, '6.3-nba-teampicks-views-and-setup', NULL, NULL, 6, 3, 'We adjust the models for a more ideal solution. We create views for three pages and migrations. There are quite a few changes here. I suggest you watch the video and if you get stuck checkout the source code.', 0, NULL, NULL, NULL),
	(287, 11, '6.4-nba-teampicks-draggable-ui', NULL, NULL, 6, 4, 'We get jQuery UI ready for sorting teams and setup a sortable list.', 0, NULL, NULL, NULL),
	(288, 11, '6.5-nba-teampicks-js-p1', NULL, NULL, 6, 5, 'We will be adding a little bit of UI features and setting up the postData to save to Django. Then we will save to the Database next.', 0, NULL, NULL, NULL),
	(289, 11, '6.6-nba-teampicks-js-p2', NULL, NULL, 6, 6, 'We finish the saving of the sortable list for the NBA team.', 0, NULL, NULL, NULL),
	(290, 11, '7.1-management-command', NULL, NULL, 7, 1, 'We create a manage.py command of our own which will fetch a URL for stats.', 0, NULL, NULL, NULL),
	(291, 11, '7.2-preparing-models-for-api', NULL, NULL, 7, 2, 'We adjust our models or "refactor" a bit so they make more sense. We then add some fields to allow our database to sync with the incoming API. There is also some troubleshooting with Git in here that was not edited out because it may be of some value, otherwise you can skip the remaining video at about 10 minutes in where we re-migrate.', 0, NULL, NULL, NULL),
	(292, 11, '7.3-populating-database-p1', NULL, NULL, 7, 3, 'Now we adjust the feed and prepare it for populating the database with actual data. I will show you how I went through and figured out how I retrieved the correct data.', 0, NULL, NULL, NULL),
	(293, 11, '7.4-seasons-admin', NULL, NULL, 7, 4, 'We have to make sure we have a season before we can populate data, so let\'s set this up and continue!', 0, NULL, NULL, NULL),
	(294, 11, '7.5-populating-database-p2', NULL, NULL, 7, 5, 'This is a longer video but we finish populating the teams with their daily scores, and update them if they have changed. Additionally a tip of two software packages I use time to time: WinMerge (Meld on Linux) and some type of SQLite Browser.', 0, NULL, NULL, NULL),
	(295, 11, '8.1-custom-user-management-model', NULL, NULL, 8, 1, 'This is another long video that could become quite complex to explain the inner workings of it. So follow along and I\'ll explain what you need to do. This is very easy to mess up by missing something, so it\'s important to follow closely or copy the code from the Git repository.', 0, NULL, NULL, NULL),
	(296, 11, '8.2-account-admin', NULL, NULL, 8, 2, 'A quick and easy setup for our user accounts for the Admin panel.', 0, NULL, NULL, NULL),
	(297, 11, '8.3-account-views-p1', NULL, NULL, 8, 3, 'We will start to develop a custom user login/logout area for users.', 0, NULL, NULL, NULL),
	(298, 11, '8.4-account-views-p2', NULL, NULL, 8, 4, 'We continue developing the views.', 0, NULL, NULL, NULL),
	(299, 2, '6.3-javascript-dashboard', NULL, NULL, 6, 3, 'We create the Dashboard base file which runs all the JavaScript. It is lightweight and simple!', 0, NULL, NULL, NULL);
