INSERT INTO `user_support` (`id`, `user_id`, `type`, `title`, `content`, `is_deleted`, `deleted_at`, `created_at`, `updated_at`) VALUES
	(1, 29, 'support', 'Soundcloud Authentication Help', 'Hello sir, I got directed here from your video tutorial on Soundcloud PHP authentication, I followed your tutorial EXACTLY and can authenticate and run queries fine, however when I refresh the page I\'m logged out. I\'m not sure what I\'m doing wrong... I even changed the session start line to session_save_path("/tmp"); but that had no effect. They couldn\'t figure it out on Stack Overflow either.\r\nThanks in advance for your help', 0, NULL, '2014-02-13 03:56:19', NULL),
	(2, 31, 'support', 'Payment', 'How I can pay one time payment? I can\'t find a link for this.  ', 0, NULL, '2014-02-13 05:50:32', NULL),
	(3, 266, 'support', 'About the file .htaccess in your PHP: Create Your Own MVC (Part 1)  Tutorial on youtube', 'Hi jream,\r\nFirst of all,thanks for your shareing the tutorial :PHP : Create Your Own MVC (Part 1) ,\r\nit is a great tutorial,very helpful.....\r\n\r\nNow i have a question,i downloaded those code from your website and uploaded them onto my hosting[Godaddy,Windows Hosting],everything is working well except the file .htaccess! If the url like this :http://www.yourdomain.com/index.php?url=xxx,It\'s fine,no problem.but if the url like this : http://www.yourdomain.com/index/xxx,The browser will give me a 404 error!\r\n\r\nI just use your .htaccess file ,it bother me two days already, i realy hope you can give me some idea to figure out this.\r\n\r\nRegards!\r\n\r\nJack', 0, NULL, '2014-03-11 02:34:29', NULL),
	(4, 332, 'error', 'Video Won\'t Play', 'Hi Jesse,\r\n\r\nYou told me to send you my registration email and you would allow access to the missing video from the PHP Punch in the Face course. My email address is mikeburnsidemail@gmail.com and this is regarding lecture #13.\r\n\r\nThanks,\r\n\r\nMike', 0, NULL, '2014-03-15 18:53:25', NULL),
	(5, 82, 'error', '6.1 and 6.2 in codeigniter course', 'Hello I\'ve been loving this series I\'ve been following all week but I just did the 6.2 video and I am completely lost because you didn\'t video changes you made at this stage.\r\nIm trying to catch up by dowloading the source but its really confusing hope to be able to put together the missing pieces and follow the rest of the course because I have learned a lot so far.... ', 0, NULL, '2014-03-28 17:27:59', NULL),
	(6, 86, 'support', 'Next movie', 'I just bought the php course and ik like it, one thin that i find annoying is that there \r\nis no next or prev function.\r\nNow i have to go back scroll down and click new movie.\r\n\r\nGreetings', 0, NULL, '2014-03-28 20:59:23', NULL),
	(7, 86, 'error', 'php 2.3', 'I cant play php 2.3 it keeps loading\r\n\r\ngreetings', 0, NULL, '2014-03-28 21:31:34', NULL),
	(8, 530, 'support', 'AngularJs and Dart tutorials', 'Hi Jessy,\r\nI\'m waiting for a full fledged mvvm video on AngularJs like the one you created for "PHP MVC". Is it possible for you to do this? I have already commented about this on youtube.\r\nI wish you success in the premium version :)\r\n\r\nThanks,\r\nKanna', 0, NULL, '2014-04-03 06:59:11', NULL),
	(9, 538, 'support', 'Delete Account', 'Hi ,\r\n          I take your php courses on Udemy and  dont  need this account.  I ask kindly to delete my account since i could not do that my self.\r\n\r\nthanks\r\n"headway"\r\n', 0, NULL, '2014-04-03 13:07:07', NULL),
	(10, 585, 'error', 'Login weirdness', 'Left my laptop for a bit and I think my session expired. This caused the login with facebook button to stop working (as well as the video) and so I got in by trying to purchase the course again, clicking on the log in with fb button there and then I got the message saying I had already purchased and all was good again.\r\n\r\nCheers.', 0, NULL, '2014-04-07 18:20:16', NULL),
	(11, 556, 'support', 'PHP CodeIgniter: Why use javescript?', 'Hey.\r\n\r\nFirst off all - nice stuff! I love your lessons about PHP CodeIgniter and your free lessons about mvc. I have never learn this before, and Im just code for fun and only flat PHP and Im new to class also but I wonder why you use javescript all the time. What are the benefits ? I suspect that you want me to buy your course about javascript , hehe ;)\r\n\r\nThanks alot!\r\n- SÃ¸ren @ Rookie from Denmark.', 0, NULL, '2014-04-07 20:26:59', NULL),
	(12, 617, 'error', 'resources in the code ignite tutorial', 'when i selected the link for the .htaccess text\r\nhttp://jream.stream.s3.amazonaws.com/php-codeigniter/resources/htaccess.txt\r\n\r\nthis is what i get\r\n<Error>\r\n<Code>AccessDenied</Code>\r\n<Message>Access Denied</Message>\r\n<RequestId>69896C072542CB4F</RequestId>\r\n<HostId>\r\naDSNCFdfUw0CH8in3BuU9hjPKcU7O87tFcZqmRUI8nThMSBWKLeq3l44iVx9Op8t\r\n</HostId>\r\n</Error>', 0, NULL, '2014-04-09 18:48:04', NULL),
	(13, 86, 'support', 'Account settings', 'Hey \r\n\r\nI registered with fb account and the email adress j.rijsewijk@matchdesign.nl\r\nnow is that mail down untill 10-05-2014 and i want to chang my mail adress to\r\njim@dayman.nl\r\n\r\ngreeting', 0, NULL, '2014-04-09 19:16:19', NULL),
	(14, 92, 'support', '[Feature request] Adding courses which are allready bought from udemy to this site', 'Hello Jesse :)\r\nIt would be nice to have access to the same courses that we have in udemy from here if we have allready bought them, i do know that this might not be possible due to that the udemy site itself doesn\'t provide us any why to detch whenever the session is set and all that but it would be cool :)', 0, NULL, '2014-04-18 01:04:32', NULL),
	(15, 722, 'support', 'MVC for LAMP Server ', 'The demo mvc project of the Jream Lab is not working in my lamp server (Ubuntu 12.04 LTS), after db config its only route to index but not rendering other pages like about or login etc.\r\ni think some misconfiguration in .htaccess i had tried to modify but failed, so can you help me ?', 0, NULL, '2014-04-21 05:07:57', NULL),
	(16, 727, 'support', 'JQuery question', 'I found you through a youtube video and so I signed up for an account on your site hoping I would have the ability to ask you some questions regarding jquery sortable. I\'m going to be breif here because i\'m sure you have a limited amount of time but I have so far been unable to find what i\'m looking for anywhere. I have a page with multiple lists and I want to be able to use the sortable feature to move from one list to another and re-organize. This is currently working fine, where i\'m runnning into issues is the ability to save the data to a database. when i\'m using just 1 list everything works fine but when moving between list I don\'t seem to be able to get the data from Jquery to be able to write the DB. For this example lets say the DB table has 4 columns... id, text, list, order... how do I get the list data? order can come from serialize but i\'m missing the middle piece here.. any help would be appreciated.. I can provide full source if need be', 0, NULL, '2014-04-21 20:22:23', NULL),
	(17, 92, 'error', 'CSRF token not correctly set up :) ', 'Hello i just tested your CSRF token setup by editing the value, in the login form (the normal form) I use facebook to login, well the CSRF token passed but it also came to the validation and set that passed, that shouldn\'t be happening should it?', 0, NULL, '2014-04-22 11:10:39', NULL),
	(18, 551, 'support', 'account problem ', 'i had purchased a course (php punch in theface ) and it\'s not displayed in my dashboard', 0, NULL, '2014-04-24 23:43:12', NULL),
