	(41, 2297, 'error', 'PHP MVC Framework when used with jquery.validate.js', 'Hi Jesse!\r\n\r\nI have been using your PHP MVC Framework for a long time now and think it is wonderful! It\'s so easy to create a professional looking and feeling website with very little effort. Great Work! \r\n\r\nI enjoy your other tutorials, as well. You make programming look like child\'s play, although it is anything but.\r\n\r\nI was, however, trying to use the jQuery form validation plugin with your MVC Framework, only to find that when I including the source for the plugin, that my forms ceased working almost completely. I couldn\'t for the life of me figure out what was going wrong. It turned out, after much frustration, and head scratching the your js file "custom.js" was the culprit. The empty document ready code was causing a major conflict, and crashing the validation plugin script, and the jQuery in general, relating to the forms. I removed the empty document ready code, and everything fired up, and worked exactly as planned.\r\n\r\nI mention this to you, because I have had bulk experience with programming, and found this bug to be a real pain. Some others may have had the same trouble?, and I thought we could spare them the frustration. This custom.js file is included up to Part 11 of the course. \r\n\r\nOtherwise, your framework is fabulous, and plays very well with everything else I have thrown at it.\r\n\r\nKeep up the great work!\r\n\r\nKelley', 0, NULL, '2014-09-25 07:32:14', NULL),
	(42, 2207, 'error', 'form validation', '$this->form_validation->error_array();\r\n\r\nthis is not returning any value please help me\r\nstring is working', 0, NULL, '2014-09-27 07:59:09', NULL),
	(43, 1637, 'error', 'Billed twice', 'Hi,\r\nit looks like I got billed twice for the CodeIgnitor course you do.  The redirected page from PayPal didn\'t work so i refreshed it, at which point it said unsuccessful so i repurchased.\r\nCan you do a refund? if not, could you add the Phalcon course to my available courses? \r\n\r\nMany Thanks\r\nChris', 0, NULL, '2014-10-01 09:07:33', NULL),
