	(45, 92, 'support', 'suggestions :)', 'Hello Jessie :)\r\n\r\nI have some site improvements for the layout of yours, and at the same time some questions :)\r\n\r\n1: i\'m curious why are you using both classes "container and container-fluid" within one div element \r\n\r\nOn twitter bootstraps official site they states that: \r\n\r\nTurn any fixed-width grid layout into a full-width layout by changing your outermost .container to .container-fluid.\r\n\r\nSo there is really no need to use both class definitions on a single container element. \r\n\r\n2: Also, i have noticed that you have been using spacer classes to define the margin between elements on the page, why not wrap that within your child div and use the psudo classes to add margin before the content and after the content of the div element? \r\n\r\nAnd last but not least i have an series request common design patterns for PHP :) \r\n', 0, NULL, '2014-10-13 00:07:41', NULL),
	(46, 92, 'error', 'Containers on your pages and a Bug', 'Bugs found:  \r\n- On the questions page Container div is not closed correctly this is causing the side to be very wide on the footer :)\r\n\r\nQuestions: why do you use both css containers (Container and Container fliud) when why do mostly the same stuff within a row element? ', 0, NULL, '2014-10-18 10:57:13', NULL),
