	(51, 828, 'support', 'Support Files', 'Hi Jesse, \r\n\r\nI asked this in Questions, maybe I\'m missing something, but the BitBucket files do not seem to be complete ?  I did get the ACL to work, but it would be easier if I could see the finished code.\r\n\r\nAnyhow, I\'m working through 7.1 / 7.2. On attempting to log in as \'user\' I get :\r\n\r\nThe collection does not exist in the manager ( for any route then ).\r\n\r\nIf I destroy the session I can get the site to work again. The assets collection works before the attempted login, so I guess the ACL stuff is responsible. I looked around and saw this on SO, exact same problem :\r\n\r\nhttp://stackoverflow.com/questions/24304851/phalcon-acl-error-with-collections\r\n\r\nAny help would be appreciated. \r\n\r\nEnjoying your tuts. Thanks.\r\n\r\nGreg.', NULL, NULL, '2014-12-11 03:10:28', NULL),
	(52, 3770, 'error', 'Question', 'Hello Jessie, I saw your tutorial about MVC and It was great. Now I am doing my website which include facebook and google+ authorization.. I am just wondering because I registered twice on your website, by using the same e-mail.. is it true that you used separate users tables in DB for each: normal registration  and facebook registration with different session_id - you allowed me to register with my e-mail even I used it by logging with facebook first.. Please explain me that, because I am implementing social network authorization as well. Thank you very much for the response. Mariusz', NULL, NULL, '2015-02-18 22:01:21', NULL),
	(53, 3739, 'support', 'Code Igniter extend CRUD model in CI 3.0 with Ucfirst', 'First wanted to say been a fan of your tuts on you tube for a while and thanks for the work you have done.\r\n\r\nI know this has to be easy and I am just prob just over thinking this too much. With creating the CRUD_model that is extended and autoloaded. In CI3.0 all class filenames follow the first letter uppercase. So after making the adjustments I still could not get it to work. ', NULL, NULL, '2015-03-04 14:04:48', NULL),
