	(55, 4100, 'support', 'routing help', 'I followed the mvc tutorials.\r\nnow i tried to introduced a folder called module in controller folder. and tried to make changes in bootstrap.php\r\n\r\nthis is my bootstarp code for calling controller and module\r\nprivate function _loadExistingModuleController() {\r\n        // print_r($this->_url);\r\n        //print_r($this->_url[0]);\r\n       // print_r($this->_url[1]);\r\n\r\n  //     $module = $this->_modulePath . $this->_url[0];\r\n// echo $module;\r\n\r\n\r\n        if(is_dir($this->_modulePath . $this->_url[0]) == true) {\r\n   //        echo 1;\r\n   		$file =  $this->_modulePath . $this->_url[0] .\'/\'. $this->_url[1] .\'.php\';\r\n            $this->file = $file;\r\n\r\n   //        echo "$file";\r\n        //   $file = $this->_dirpath . $this->_url[1] .\'.php\';\r\n //echo "$file";\r\n                if (file_exists($file)) {\r\n                  //  echo 1;\r\n                require $file;\r\n\r\n                $this->_controller = new $this->_url[1];\r\n                $this->_controller->loadModel($this->_url[1], $this->_modelPath);\r\n            } else {\r\n                $this->_error();\r\n                return false;\r\n            }\r\n\r\n        } else {\r\n            $this->_error();\r\n            return false;\r\n        }\r\n\r\n    }\r\n\r\n\r\n\r\n    private function _callExistingModuleControllerMethod()\r\n    {\r\n        // count the length of $url array\r\n        $length = count($this->_url);\r\n\r\n        // Make sure the method we are calling exists\r\n        if ($length > 2) {\r\n            if (!method_exists($this->_controller, $this->_url[2])) {\r\n                $this->_error();\r\n            }\r\n        }\r\n\r\n        // Determine what to load\r\n        switch ($length) {\r\n            case 5:\r\n                //Module[0]->Controller[1]->{Method[2]}(Param1[3], Param2[4], Param3[5], Param4[6])\r\n                $this->_controller->{$this->_url[2]}($this->_url[3], $this->_url[4], $this->_url[5], $this->_url[6]);\r\n                break;\r\n\r\n            case 4:\r\n                //Controller->Method(Param1, Param2, Param3)\r\n                $this->_controller->{$this->_url[2]}($this->_url[3], $this->_url[4], $this->_url[5]);\r\n                break;\r\n\r\n            case 3:\r\n                //Controller->Method(Param1, Param2)\r\n                $this->_controller->{$this->_url[2]}($this->_url[3], $this->_url[4]);\r\n                break;\r\n\r\n            case 2:\r\n                //Controller->Method(Param1)\r\n                $this->_controller->{$this->_url[2]}($this->_url[3]);\r\n                break;\r\n\r\n            case 1:\r\n                $this->_controller->{$this->_url[2]}();\r\n                break;\r\n\r\n            default:\r\n                // No Method : Controller\r\n                $this->_controller->index();\r\n                break;\r\n\r\n        }\r\n    }\r\n\r\n\r\nbut dont know where is the mistake.\r\n\r\nplease help\r\n', NULL, NULL, '2015-03-25 09:42:22', NULL),
