	(60, 4409, 'error', 'MY_Form_validation problem', 'hi good day first of all thumbs up on the tutorials i\'m enjoying codeigniter the way you teach \r\ni have one issue which is preventing me moving forward \r\n\r\nfor  5.2 Extending Form Validator\r\ni thought it maybe my code but i copied and pasted the register function and the MY_Form_validation class  from the code you made available on the bitbucket \r\n\r\ni get this error \r\nFatal error: Call to undefined method CI_Form_validation::error_array() in /home/scotiadesignco/public_html/tfsv/application/controllers/user.php on line 41 which i gather means its not reading the library or not getting the function error_array \r\nwhen i replace the $this->form_validation->error_array() with validation errors () i get the json string back like this\r\n{"result":0,"error":"The Login field is required.\\nThe Email field is required.\\nThe Password field is required.\\n"}\r\ni removed the statement to run after ->run and replaced it with a load ->view  and managed to echo the validation errors but that  prevents the session being set \r\ndo you know what can be causing this ?\r\ni have put the code back to original state  and can be seen through network tab  at \r\nhttp://www.scotiadesign.co.uk/tfsv/home/register\r\ni will try continue as much as i can in the meantime \r\nmany thanks \r\nany help would be appreciated thanks\r\n\r\nchris keenan', NULL, NULL, '2015-05-14 03:49:47', NULL),
